import * as React from 'react';
import {
  Navbar,
  NavbarBrand,
  NavbarContent,
  NavbarItem,
  Link,
  Button,
} from '@nextui-org/react';

function Nav() {
  return (
    <Navbar maxWidth={'full'} color="secondary" isBordered shouldHideOnScroll>
      <NavbarContent justify="start">
        <NavbarBrand>
          <p className="font-bold text-inherit">AchieveIt</p>
        </NavbarBrand>
      </NavbarContent>
      <NavbarContent justify="end">
        <NavbarItem>
          <Button as={Link} color="secondary" href="#" variant="flat">
            Login
          </Button>
        </NavbarItem>
      </NavbarContent>
    </Navbar>
  );
}

export default Nav;
